import Axios from "axios";
import React, { useEffect, useState } from "react";
import { Modal, Button } from "react-bootstrap";

import colors from "../../config/colors";

import "./Modal.css";

function ModalComponent(props) {
  const [userDetail, setUserDetailed] = useState({
    accountNo: "",
    name: "",
    email: "",
    balance: "",
    branchName: "",
    contactNo: "",
    accountType: "",
    createdAt: "",
  });

  useEffect(() => {
    if (props.accountno !== undefined && props.accountno !== "")
      Axios.get("http://localhost:5000/search/" + props.accountno)
        .then((response) => setUserDetailed(response.data))
        .catch((e) => {
          console.log("Can't catch the response...", e);
        });
  }, [props.accountno]);
  console.log("UserDetail: ", userDetail);
  return (
    <Modal
      {...props}
      size="lg"
      aria-labelledby="contained-modal-title-vcenter"
      centered
    >
      <Modal.Header closeButton>
        <Modal.Title
          id="contained-modal-title-vcenter"
          className="w-100 text-center title"
        >
          Update User Profile
        </Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <div>
          <label htmlFor="account-no" className="title2">
            Account No :
          </label>
          <input
            type="text"
            id="account-no"
            name="Account No"
            value={props.accountno}
            className="input-field"
            disabled
          />
          <label htmlFor="fullName" className="title2">
            Full Name :
          </label>
          <input
            type="text"
            id="Full name"
            name="Full Name"
            value={userDetail.name}
            className="input-field"
            disabled
          />
        </div>
        <div>
          <label htmlFor="email" className="title2">
            Email Id :
          </label>
          <input
            type="text"
            id="email"
            name="Email"
            value={userDetail.email}
            // onChange={(event) =>
            //   setUserDetailed((prevState) => {
            //     return { ...prevState, emailId: event.target.value };
            //   })
            // }
            className="input-field"
            disabled
          />
          <label htmlFor="balance" className="title2">
            Balance :
          </label>
          <input
            type="text"
            id="balance"
            name="Balance"
            value={` $ ${userDetail.balance}`}
            className="input-field"
            style={{ backgroundColor: colors.light3, fontWeight: 600 }}
            disabled
          />
        </div>
        <div>
          <label htmlFor="branch-name" className="title2">
            Branch Name :
          </label>
          <input
            type="text"
            id="branch-name"
            name="Branch Name"
            value={userDetail.branchName}
            // onChange={(event) =>
            //   setState((prevState) => {
            //     return { ...prevState, emailId: event.target.value };
            //   })
            // }
            className="input-field"
            disabled
          />
          <label htmlFor="contact-no" className="title2">
            Contact No :
          </label>
          <input
            type="text"
            id="contact-no"
            name="Contact No"
            value={userDetail.contactNo}
            className="input-field"
            // style={{ backgroundColor: colors.light3 }}
            disabled
          />
        </div>
        <div>
          <label htmlFor="account-type" className="title2">
            Account Type :
          </label>
          <input
            type="text"
            id="account-type"
            name="Account Type"
            value={userDetail.accountType}
            // onChange={(event) =>
            //   setState((prevState) => {
            //     return { ...prevState, emailId: event.target.value };
            //   })
            // }
            className="input-field"
            disabled
          />
          <label htmlFor="opening" className="title2">
            Opening Date :
          </label>
          <input
            type="text"
            id="opening"
            name="Openning Date"
            value={userDetail.createdAt.substr(0, 10)}
            className="input-field"
            // style={{ backgroundColor: colors.light3 }}
            disabled
          />
        </div>
      </Modal.Body>
      <Modal.Footer>
        <Button onClick={props.onHide}>Close</Button>
        <Button>Save Changes</Button>
      </Modal.Footer>
    </Modal>
  );
}

export default ModalComponent;
